;; gorilla-repl.fileformat = 1

;; **
;;; # Vietnam IMO
;;; 
;;; Data from [wiki]( https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam_t%E1%BA%A1i_Olympic_To%C3%A1n_h%E1%BB%8Dc_Qu%E1%BB%91c_t%E1%BA%BF)
;; **

;; @@
(ns radioactive-firefly
  (:require [gorilla-samples.util :as util]
    		[gg4clj.core :as gg4clj]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def imo (util/read-csv "imo.csv"))

(def df (gg4clj/data-frame {:year   (map (comp read-string :year) imo)
                          	:school (map :school imo)}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-firefly/df</span>","value":"#'radioactive-firefly/df"}
;; <=

;; @@
(gg4clj/view [[:<- :g df]
              (gg4clj/r+
                [:ggplot :g [:aes {:x :year, :y :school}]]
                [:geom_joy2]
                #_[:scale_y_discrete {:expand [:c 0.01 0]}]
                #_[:scale_x_continuous {:breaks [:seq 0 24 {:by 2}]
                                      :expand [:c 0 0]}]
                [:theme_joy {:font_size 9}]
                #_[:labs {:title "Messages per Hour"
                        :y     :NULL}])])
;; @@
;; ->
;;; Error in FUN(X[[i]], ...) : need at least 2 data points
;;; Calls: &lt;Anonymous&gt; ... &lt;Anonymous&gt; -&gt; f -&gt; &lt;Anonymous&gt; -&gt; f -&gt; vapply -&gt; FUN
;;; Execution halted
;;; 
;;; 
;; <-
;; =>
;;; {"type":"html","content":"","value":-1989142557}
;; <=

;; **
;;; ## Top Schools
;; **

;; @@
(def top-schools (->> (group-by :school imo)
                	  (map (fn [[k v]] [k (count v)]))
	                  (sort-by last)
                      (take-last 10)))

(gg4clj/view [[:<- :g (gg4clj/data-frame {:school (map first top-schools)
			                              :no     (map second top-schools)})]
              (gg4clj/r+
                [:ggplot :g [:aes {:x :school, :y :no, :fill [:reorder :school [:- :no]]}]]
                [:geom_col {:width 0.8}]
                [:coord_polar {:theta "y"}]
                [:theme {:axis.text [:element_blank]
                         :axis.ticks [:element_blank]}]
                [:scale_fill_brewer {:palette "Set3"}]
                [:labs {:title "Top 10"
                        :fill "School"
                        :x :NULL, :y :NULL}])])
;; @@
